SELECT 
    j.Nume AS Judet, 
    COUNT(l.IdOras) AS NrLocalitati
FROM Judet j
LEFT JOIN Localitate l ON j.IdJudet = l.IdJudet
GROUP BY j.Nume
ORDER BY NrLocalitati DESC;

SELECT COUNT(*) AS TotalLocalitati FROM Localitate;

